import {
  SliderContainer,
  SliderImage,
  SliderSubText,
  SliderText,
  SliderTitle,
} from "./styles";

type bannerSliderItems = {
  title?: string;
  price: string;
  description?: string;
  image?: string;
  rooms?: string;
  baths?: string;
};

export default function Slider({
  price,
  title,
  image,
  description,
  rooms,
  baths,
}: bannerSliderItems) {
  return (
    <SliderContainer>
      <SliderTitle>{title}</SliderTitle>
      <SliderSubText>{price}</SliderSubText>
      <SliderImage src={image}></SliderImage>
      <SliderText>{description}</SliderText>
      <SliderText>{rooms}</SliderText>
      <SliderText>{baths}</SliderText>
    </SliderContainer>
  );
}
